import React from 'react';


const LineSheets = () => {
    return (
        <div className="container flex-container">
            <div className="row">
                <div className="col-md-1" />
                <div className="col-md-5">
                    <img id="shop-image" src="images/shop.png" alt='shop' />
                </div>
                <div className="col-md-5" id="shop-text" style={{ marginTop: "100px" }}>
                    <h2>Line Sheets</h2>
                    <p>Paper and Electronic<br />
                    Images, Sizing, Pricing, Page Order Summary, Contact Listed, Company info <br /></p>
                </div>
                <div className="col-md-1" />
            </div>
        </div>
    )
}

export default LineSheets;
